export function add05(a: number, b: number): number {
  return a + b;
}

export function subtract05(a: number, b: number): number {
  return a - b;
}

export function multiply05(a: number, b: number): number {
  return a * b;
}

export function divide05(a: number, b: number): number {
  return a / b;
}
